export const toc = [{
  value: '3D Printing',
  id: '3d-printing',
  children: []
}, {
  value: 'Dismantle Mouse  Logitech M170',
  id: 'dismantle-mouse--logitech-m170',
  children: []
}, {
  value: 'Assemble Right Button',
  id: 'assemble-right-button',
  children: []
}, {
  value: ' Assemble Left Button',
  id: 'assemble-left-button',
  children: []
}, {
  value: ' Assemble the C-type Clamp',
  id: 'assemble-the-c-type-clamp',
  children: []
}, {
  value: 'Assemble flexible tube',
  id: 'assemble-flexible-tube',
  children: []
}, {
  value: 'Final assembly',
  id: 'final-assembly',
  children: []
}];

const layoutProps = {
  toc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`The Worm accessible keyboard allows the user to interact with a PC, tablet or smartphone using 3 commands, which enables the selection of items on the screen with OTTAA Project's screen scan functionality (Move right or left and select).`}</p>
    <p>{`The device has been specifically designed for motor impaired people who have difficulties in their fine motor skills.
It is compatible with Android, Windows, MacOS and Linux.`}</p>
    <p><img alt={"WhatsApp Image 2020-10-06 at 14.28.40.jpeg"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./../static/img/worms.jpeg").default} /></p>
    <h1 {...{
      "id": "materials"
    }}>{`Materials`}</h1>
    <ul>
      <li parentName="ul">{`Bale wire 2mm x 590mm.`}</li>
      <li parentName="ul">{`Black synthetic hose 4x7mm x 600mm.`}</li>
      <li parentName="ul">{`Limit switch (x9).`}</li>
      <li parentName="ul">{`PCB - Logitech M170 Mouse.`}</li>
      <li parentName="ul">{`Battery holder case.`}</li>
      <li parentName="ul">{`Switch ON/OFF.`}</li>
      <li parentName="ul">{`3.5mm male Jack and stereo female socket (x2 each).`}</li>
      <li parentName="ul">{`Bipolar cable D: 4mm, L: 50cm.`}</li>
      <li parentName="ul">{`O-shaped ring, D:50mm (x3).`}</li>
      <li parentName="ul">{`Self-tapping screw 2.5mm.`}</li>
      <li parentName="ul">{`Screw M8 (75mm).`}</li>
      <li parentName="ul">{`Nut (M8).`}</li>
      <li parentName="ul">{`3D printed C-type clamp (3 parts). Link: `}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/1q8pt_Tc9yp30RNbcw8l60s-WcBIo4n65/view?usp=sharing"
        }}>{`M`}</a>{`, `}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/1WTxBhuesPkDgji2PdniFsReWqprZWFa9/view?usp=sharing"
        }}>{`N`}</a>{`, `}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/124NCF8SRWjaoeRgZaaqb9-l5KFv0VJqr/view?usp=sharing"
        }}>{`O`}</a>{`.`}</li>
      <li parentName="ul">{`3D printed Accept Button (5 parts). Link: `}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/1h_F0gbu5rrsd9OKOocq628bNDKaxRvq0/view?usp=sharing"
        }}>{`P`}</a>{`, `}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/1OsxYsJxxDckRL8vdeQqWA4Y82mbkkstp/view?usp=sharing"
        }}>{`Q`}</a>{`, `}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/1xL6k8kxHQhgLL_lPmevPxlBy2CNAeDGq/view?usp=sharing"
        }}>{`R`}</a>{`, `}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/1yS8quPk7pbEb4WxdDVrEHb_aqjrXKeSZ/view?usp=sharing"
        }}>{`S`}</a>{`, `}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/1XYNbZZP-u4jPhww7EVhSIyInC8K279Kw/view?usp=sharing"
        }}>{`T`}</a>{`.`}</li>
      <li parentName="ul">{`3D printed Right Button (3 parts). Link: `}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/1h0bkYA0eYd6-Q-3komtwQxRLjLJ1WJws/view?usp=sharing"
        }}>{`U`}</a>{`, `}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/1Yas75XJbZLEOfESdPhgSxmrnA-9inPtk/view?usp=sharing"
        }}>{`V`}</a>{`, `}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/1vNSCoIjoTm8usaYAx7RvuRkmeK1WUOqJ/view?usp=sharing"
        }}>{`W`}</a>{`.`}</li>
      <li parentName="ul">{`3D printed Left Button (3 parts). Link: `}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/15imiRSKJwuGtycxIAygMaGpuIfjjPAGn/view?usp=sharing"
        }}>{`X`}</a>{`, `}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/1YurHOTdBFYS9Ibjdun6ofMPSIcmrr318/view?usp=sharing"
        }}>{`Y`}</a>{`, `}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/1rngqET3UWs7N8oFh70l9hl5s22rMiVWx/view?usp=sharing"
        }}>{`Z`}</a>{`.`}</li>
      <li parentName="ul">{`3D printed Cable Connector (x2). Link: `}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/1dSQIOXJcjEa6XMHrVBW0lc3gF5BdvAX6/view?usp=sharing"
        }}>{`AA`}</a>{`.`}</li>
      <li parentName="ul">{`3D printed End Caps (x2). Link: `}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/1VOLtOgkQFtzj87MXfqcwVaIC_Cm7pYkP/view?usp=sharing"
        }}>{`AB`}</a>{`.`}</li>
    </ul>
    <h1 {...{
      "id": "procedure"
    }}>{`Procedure`}</h1>
    <h2 {...{
      "id": "3d-printing"
    }}>{`3D Printing`}</h2>
    <p>{` Parts M, N, O, P, Q, R, S, T, U, V, W, X, Y, Z, AA and AB 3D printing settings: `}</p>
    <ul>
      <li parentName="ul">{`Material: PLA.`}</li>
      <li parentName="ul">{`Temperature of the hotend: 210-215 °C.`}</li>
      <li parentName="ul">{`Temperature of the print bed: 50-60 °C.`}</li>
      <li parentName="ul">{`Top and Bottom Layers: 3.`}</li>
      <li parentName="ul">{`Perimeter Shells: 3.`}</li>
      <li parentName="ul">{`Infill: 25%.`}</li>
      <li parentName="ul">{`Support: 75°(only X.stl).`}</li>
    </ul>
    <h2 {...{
      "id": "dismantle-mouse--logitech-m170"
    }}>{`Dismantle Mouse  Logitech M170`}</h2>
    <ul>
      <li parentName="ul">{`Take out the mouse PCB and remove the limit switches from the left, right and scroll click.
Assemble the Accept Button`}</li>
      <li parentName="ul">{`Weld the ON/OFF switch terminals to a cable. Introduce the switch into part P as shown in `}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/1rQlzX3SA1ZpK4RqxPKlBLPkC3BN2ieWl/view?usp=sharing"
        }}>{`Figure 12`}</a>{`. Then apply pressure to fit part S to the switch as shown in `}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/1B6Fadx-2Dt2_RyQQ3_Fai0At_Tww5DyD/view?usp=sharing"
        }}>{`Figure 13`}</a>{`.`}</li>
      <li parentName="ul">{`With the help of a cable, connect 3 limit switches in a parallel connection, and then weld the cable to the PCB.
Place the limit switches in part P as shown in `}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/1lvGDZfQDvGuciLXX7o622FTA1hyLDtzi/view?usp=sharing"
        }}>{`Figure 14`}</a>{` and secure the joint with glue.`}</li>
      <li parentName="ul">{`Weld the terminals of a 3.5mm Jack plug to a bipolar cable, and introduce it in part P as shown in `}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/1AoxQKYjDpqbXABTT8KVyjfN5UgnzqPPY/view?usp=sharing"
        }}>{`Figure 15`}</a>{`. `}</li>
      <li parentName="ul">{`Weld the terminals of the battery holder case to a bipolar cable. Introduce it in part P as shown in `}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/1rCBej79M5l-g3fGtbqzbrjm_DL0UZ_bf/view?usp=sharing"
        }}>{`Figure 16`}</a>{`. Part P has 2 protruding ends; first, in a diagonal direction, fit one of the protruding ends into the hole of part P, then straighten it and apply pressure until the second protruding end locks.`}</li>
      <li parentName="ul">{`Introduce the metal spring over the PCB as shown in `}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/13SZR6xpKsCX0LVE47rKoHvujnwL6-bz8/view?usp=sharing"
        }}>{`Figure 17`}</a>{`.`}</li>
      <li parentName="ul">{`Place the O-shaped ring on the depression/indentation of part R, cut it to size (`}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/1RYr3k5bBD5nfrlU_CzCFEdPdczC2YMYv/view?usp=sharing"
        }}>{`Figure 18`}</a>{`) and glue it. `}</li>
      <li parentName="ul">{`Insert a AA battery in the battery holder case, then the battery cover (R) on part P, and fix it with the 2.5mm screw (`}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/1ACtYV6GcBX-9Hxl8Jr9_NSbUKZPURiJR/view?usp=sharing"
        }}>{`Figure 19`}</a>{`).`}</li>
      <li parentName="ul">{`Fit part T with part Q as shown in `}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/1fJrsaHwCh4zcejAyyrfOkX37XuOHInPE/view?usp=sharing"
        }}>{`Figure 20`}</a>{`, and optionally use a few drops of glue to secure the joint.`}</li>
      <li parentName="ul">{`For the final assembly of the Accept Button, part P has 3 slots and part Q has 3 protruding ends. In a diagonal direction, match one of the protruding ends with one slot and apply pressure. Then straighten, match and apply pressure on the second protruding end and repeat for the third one (`}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/1cHqCND0B8KEiWSx2E8kIIdvJVVLjs4nQ/view?usp=sharing"
        }}>{`Figure 21`}</a>{`).`}</li>
    </ul>
    <h2 {...{
      "id": "assemble-right-button"
    }}>{`Assemble Right Button`}</h2>
    <ul>
      <li parentName="ul">{`Connect 3 limit switches in a parallel connection with a wire and weld them to a Jack plug and the stereo output cable. Place them in part U, and optionally use glue to assure them.`}</li>
      <li parentName="ul">{`Place the 3.5mm Jack plug in part U.`}</li>
      <li parentName="ul">{`Attach with silicone the metal spring inside the part U.`}</li>
      <li parentName="ul">{`Put the O-shaped ring in the depression of part U, cut it to size and glue it.`}</li>
      <li parentName="ul">{`Fix part W inside part V, and glue it to secure the joint.`}</li>
      <li parentName="ul">{`For the final assembly of the Right Button, part U has 3 slots and part V has 3 protruding ends. In a diagonal direction, match one of the protruding ends with one slot and apply pressure. Then straighten, match and apply pressure on the second protruding end and repeat for the third one.`}</li>
    </ul>
    <h2 {...{
      "id": "assemble-left-button"
    }}>{` Assemble Left Button`}</h2>
    <ul>
      <li parentName="ul">{`Repeat the assembly instructions for the Right Button but with parts X, Z y Y respectively.`}</li>
    </ul>
    <h2 {...{
      "id": "assemble-the-c-type-clamp"
    }}>{` Assemble the C-type Clamp`}</h2>
    <ul>
      <li parentName="ul">{`Put the M8 nut inside part M (`}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/14cTdeDuYhEmQXeikW_6okFefL1tUqB2_/view?usp=sharing"
        }}>{`Figure 22`}</a>{`). `}</li>
      <li parentName="ul">{`Put part N on the head of the M8(L:75mm) screw, glue part O to another M8 nut and screw it onto the other end of
the screw (`}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/1UdzVvtWSO6FzaCjtwp5y0qqC_qhxe14q/view?usp=sharing"
        }}>{`Figure 23`}</a>{`).`}</li>
    </ul>
    <h2 {...{
      "id": "assemble-flexible-tube"
    }}>{`Assemble flexible tube`}</h2>
    <ul>
      <li parentName="ul">{`Insert the bale wire through the black synthetic hose (`}<a parentName="li" {...{
          "href": "https://drive.google.com/file/d/1ytznJ6Dx3ie2Mmk0hXzn9c9g3CHrehi9/view?usp=sharing"
        }}>{`Figure 24`}</a>{`).`}</li>
    </ul>
    <h2 {...{
      "id": "final-assembly"
    }}>{`Final assembly`}</h2>
    <p>{`Slip the flexible tube through the different parts in the following order (`}<a parentName="p" {...{
        "href": "https://drive.google.com/file/d/1mdMFzmLQTm70sTvSO2xS2UUelZFA9TRQ/view?usp=sharing"
      }}>{`Figure 25`}</a>{`): `}</p>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`Right button (RB).
Part AA.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Accept button (AB).
Part AA.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Left button (LB).`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Then connect the 3.5mm Jack plug.
Finally, insert parts AB in the ends of the flexible tube (`}<a parentName="p" {...{
            "href": "https://drive.google.com/file/d/1428wQbDjR6KauWpdjf-VbCYKN3hDbRQH/view?usp=sharing"
          }}>{`Figure 26`}</a>{`).`}</p>
      </li>
    </ul>
    <h1 {...{
      "id": "blueprints"
    }}>{`Blueprints`}</h1>
    <p>{` The technical drawings of the parts to be printed are shown below:`}</p>
    <p>{`  `}<a parentName="p" {...{
        "href": "https://drive.google.com/file/d/1h-aIltuCLblI2W78LPYzlvNGXgW-M7HA/view?usp=sharing"
      }}>{`M`}</a></p>
    <p>{`  `}<a parentName="p" {...{
        "href": "https://drive.google.com/file/d/1imSy_1yKplfnwEYDrAsRQntj1dBfBskF/view?usp=sharing"
      }}>{`O`}</a></p>
    <p>{`  `}<a parentName="p" {...{
        "href": "https://drive.google.com/file/d/1kkOzZ7JO2MZLPcO1KjxFinN6zsRDZm0u/view?usp=sharing"
      }}>{`P`}</a></p>
    <p>{`  `}<a parentName="p" {...{
        "href": "https://drive.google.com/file/d/1LP3YjO9mehvHfq2WQQK3GjY7wqRJR87o/view?usp=sharing"
      }}>{`Q`}</a></p>
    <p>{`  `}<a parentName="p" {...{
        "href": "https://drive.google.com/file/d/1YMVOBhYuRTnAS3Xd-2nJuZlQ3G1HnI6-/view?usp=sharing"
      }}>{`R`}</a></p>
    <p>{`  `}<a parentName="p" {...{
        "href": "https://drive.google.com/file/d/10RLvbABaNu9vJlZtUGHPG9Q2qrcCFea3/view?usp=sharing"
      }}>{`S`}</a></p>
    <p>{`  `}<a parentName="p" {...{
        "href": "https://drive.google.com/file/d/1p0-XZCEUTZ7WnjZa9hsrX5QiP_SQjz_T/view?usp=sharing"
      }}>{`T`}</a></p>
    <p>{`  `}<a parentName="p" {...{
        "href": "https://drive.google.com/file/d/1IjCXOyZUJaD7C0t5EFhq3R_xoRD52JDg/view?usp=sharing"
      }}>{`U`}</a></p>
    <p>{`  `}<a parentName="p" {...{
        "href": "https://drive.google.com/file/d/1ku8uqe_EzDjduabWlKVjGv6e6Dx1fA9H/view?usp=sharing"
      }}>{`V`}</a></p>
    <p>{`  `}<a parentName="p" {...{
        "href": "https://drive.google.com/file/d/1bViPEm1c_L357mzUrjNvdonatj7pPMmm/view?usp=sharing"
      }}>{`W`}</a></p>
    <p>{`  `}<a parentName="p" {...{
        "href": "https://drive.google.com/file/d/1_dQ33h2VjdV10Mwi0xnOLqZ7erRofAWJ/view?usp=sharing"
      }}>{`X`}</a></p>
    <p>{`  `}<a parentName="p" {...{
        "href": "https://drive.google.com/file/d/1eeuOqx4EJiWxCU11KbM_uZMvs8Tp_VLY/view?usp=sharing"
      }}>{`Y`}</a></p>
    <p>{`  `}<a parentName="p" {...{
        "href": "https://drive.google.com/file/d/1hIlxyVn3Vz8g4VswmLNRQKtG-lTH23Hp/view?usp=sharing"
      }}>{`Z`}</a></p>
    <p>{`  `}<a parentName="p" {...{
        "href": "https://drive.google.com/file/d/1aKx8SjseYHh3RLbVAavMC9ip8TMVPM0g/view?usp=sharing"
      }}>{`AA`}</a></p>
    <p>{` `}<a parentName="p" {...{
        "href": "https://drive.google.com/file/d/1uGO87a0VeIWkcusnN8bqnCaczfREzEao/view?usp=sharing"
      }}>{`AB`}</a></p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
